query ReceivedMessages($type: String!) {
  messages(type: $type, limit: 30) {
    __typename
    id
    createdAt
    ...MessageFragment
  }
}

fragment MessageFragment on Message {
  id
  question
  content
  reply
  createdAt
  updatedAt
}

10ae521c718fee919520bf95d2cdc74ee1bd0d86:
query ReceivedMessagesFromCursor($input: MessagesFromCursorInput!) {
  messagesFromCursor(input: $input) {
    __typename
    data {
      __typename
      id
      createdAt
      ...MessageFragment
    }
    hasMore
    cursor {
      __typename
      id
      createdAt
    }
  }
}

fragment MessageFragment on Message {
  id
  question
  content
  reply
  createdAt
  updatedAt
}
